import styled from 'styled-components';
import Container from '../components/Container';
import {frontEnd} from '../techData.js';

export default function TechStack() {
  return(
    <Container bg={[3,4]}>
      <h1>Tech Stack:</h1>
      <div>
        {frontEnd.map((data, index) => (
          <div>
            {data.name}
            <svg src={`../logos/JavaScript.svg`} alt={data.name + 'logo'}/>
          </div>
        ))}
      </div>
    </Container>
  )
};
